import React, { useEffect, useState } from 'react';

function App() {
  const url = 'https://huddle-cms.vercel.app/db.json';
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch(url)
      .then(response => response.json())
      .then(data => setData(data[2].data))
  }, [])  

  return (
    <div className="App">
      {
        data.map(i => {
          return (
            <div>
              <h1>{i.title}</h1>
              <p>{i.text}</p>
            </div>
          )
        })
      }
    </div>
  );
}

export default App;
